export default {
  name: "monitor",
  data: function data() {
    return {
      loading: false,
      go: "",
      url: "",
      html: "",
      height: "525px"
    };
  },
  computed: {},
  methods: {
    initUrl: function initUrl() {
      var url = this.$route.meta.url;

      if (url !== null && url !== undefined) {
        this.url = url;
        this.go = url; // window.open(this.go);

        this.loading = true;
        var that = this; // 判断iframe是否加载完毕

        var iframe = document.getElementById("iframe");

        if (iframe.attachEvent) {
          iframe.attachEvent("onload", function () {
            //iframe加载完成后你需要进行的操作
            that.loading = false;
          });
        } else {
          iframe.onload = function () {
            //iframe加载完成后你需要进行的操作
            that.loading = false;
          };
        }
      }
    },
    handleGo: function handleGo() {
      var url = this.url;
      this.go = this.url;
    },
    handleOpen: function handleOpen() {
      window.open(this.url);
    }
  },
  watch: {
    $route: function $route(to, from) {
      this.initUrl();
    }
  },
  mounted: function mounted() {
    // 计算高度
    var height = document.documentElement.clientHeight;
    this.height = Number(height - 217) + "px";
    this.initUrl();
  }
};
